type ShibnobiConstructorParams =
  | [signer?: Signer]
  | ConstructorParameters<typeof ContractFactory>;

const isSuperArgs = (
  xs: ShibnobiConstructorParams
): xs is ConstructorParameters<typeof ContractFactory> => xs.length > 1;

export class Shibnobi__factory extends ContractFactory {
  constructor(...args: ShibnobiConstructorParams) {
    if (isSuperArgs(args)) {
      super(...args);
    } else {
      super(_abi, _bytecode, args[0]);
    }
  }

  override deploy(
    overrides?: Overrides & { from?: PromiseOrValue<string> }
  ): Promise<Shibnobi> {
    return super.deploy(overrides || {}) as Promise<Shibnobi>;
  }
  override getDeployTransaction(
    overrides?: Overrides & { from?: PromiseOrValue<string> }
  ): TransactionRequest {
    return super.getDeployTransaction(overrides || {});
  }
  override attach(address: string): Shibnobi {
    return super.attach(address) as Shibnobi;
  }
  override connect(signer: Signer): Shibnobi__factory {
    return super.connect(signer) as Shibnobi__factory;
  }

  static readonly bytecode = _bytecode;
  static readonly abi = _abi;
  static createInterface(): ShibnobiInterface {
    return new utils.Interface(_abi) as ShibnobiInterface;
  }
  static connect(
    address: string,
    signerOrProvider: Signer | Provider
  ): Shibnobi {
    return new Contract(address, _abi, signerOrProvider) as Shibnobi;
  }
}
